import React from 'react';
import Login from './login'
import Upload from './upload'
import {
  BrowserRouter,
  Switch,
  Route
} from 'react-router-dom'
import 'antd/dist/antd.css'

function App() {
  return ( <
    div style = {
      {
        height: '100%'
      }
    } >
    <
    BrowserRouter >
    <
    Switch >
    <
    Route path = '/'
    exact component = {
      Login
    }
    /> <
    Route path = '/login'
    exact component = {
      Login
    }
    /> <
    Route path = '/upload'
    exact component = {
      Upload
    }
    /> <
    /Switch> <
    /BrowserRouter> <
    /div>
  );
}

export default App;
